def words_in_sentence(sentence):
    def is_prime(n):
        if n <= 1:
            return False
        for i in range(2, int(n**0.5) + 1):
            if n % i == 0:
                return False
        return True

    words = sentence.split()
    prime_length_words = [word for word in words if is_prime(len(word))]
    return ' '.join(prime_length_words)

def order_by_points(nums):
    """
    Sorts the given list of integers in ascending order according to the sum of their digits.
    If there are several items with similar sum of their digits, they are ordered based on their index in original list.
    """
    return sorted(nums, key=lambda x: (sum(int(d) for d in str(abs(x))), nums.index(x)))

def specialFilter(nums):
    def isEligible(n):
        n = abs(n)  # Consider the absolute value for negative numbers
        first_digit = int(str(n)[0])
        last_digit = int(str(n)[-1])
        return n > 10 and first_digit % 2 != 0 and last_digit % 2 != 0

    return sum(isEligible(num) for num in nums)

def bf(planet1, planet2):
